    return(
        <TouchableOpacity onPress={props.onPress}>
            <View styles={{...styles.button, ...props.style}}>

                <Text styles={{...styles.buttonText, ...props.textStyling}}>
                    {title}
                </Text>


            </View>
        </TouchableOpacity>
    );
};

const styles= StyleSheet.create({
    button: {
        backgroundColor: 'black', 
        paddingVertical: 12, 
        paddingHorizontal: 25,
        borderRadius: 25
    },

    buttonText: {
        color: 'white', 
        fontSize: 18, 

    },
});

export default CustomButton;
